import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import ParkingCardList from '../../Components/ParkingCardList/ParkingCardList'
import {
  createStackNavigator,
  HeaderStyleInterpolators,
} from '@react-navigation/stack';
// import { createStackNavigator } from 'react-navigation-stack'

import { NavigationContainer } from '@react-navigation/native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'
    }
})

class ParkingResults extends React.Component {

    render() {
        const Stack = createStackNavigator();
        return (
            <View style={{flex: 1}}>
                <Stack.Navigator>

                    <Stack.Screen
                        name="ParkingCardList"
                        component={ParkingCardList}
                        options={{
                        title: 'ParkingCardList',
                        // ...TransitionPresets.ModalSlideFromBottomIOS,
                        }}
                    />
                </Stack.Navigator>

                {/* <ParkingCardList></ParkingCardList> */}
            </View>
        );
    }
}
export default ParkingResults;
